<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Document</title>
    <link rel="stylesheet" href="https://stackpath.bootstrapcdn.com/bootstrap/4.4.1/css/bootstrap.min.css"
        integrity="sha384-Vkoo8x4CGsO3+Hhxv8T/Q5PaXtkKtu6ug5TOeNV6gBiFeWPGFN9MuhOf23Q9Ifjh" crossorigin="anonymous" />

    <style>
        .container {
            max-width: 792px !important;
        }

        .section {
            border-bottom: 2px solid black;
            padding-bottom: 15px;
            margin: 0 40px 0 20px;
        }

        .section:last-child {
            border-bottom: 0;
        }

        .section:nth-child(2) {
            margin: 40px 40px 20px 20px;
        }

        .sub_section {
            padding-bottom: 20px;
        }

        .sub_section_block {
            border-bottom: 1px solid black;
        }
        .sub_section_block:last-child {
            border-bottom: 0;
        }

        .subSection_elements {
            padding: 16px 0;
            border-bottom: 1px solid;
        }
        .subSection_elements:last-child {
            border-bottom: 0;
        }

        .lable_value {
            font-size: 10px;
            margin-bottom: 0;
        }

        .header-title {
            display: inline-block;
            width: 100%;
        }

        .header-title h6 {
            margin-left: 100px;
            text-transform: uppercase;
        }

        .header-title p {
            margin-left: 186px;
        }

        .img_container img {
            margin-left: 152px;
        }

        .header-title p {
            font-size: 9px;
        }

        .header-logo {
            float: right;
            margin: 10px 0 0 0;
        }

        /* .header-logo img {
            width: 120px;
        } */

        .Section_name {
            margin: 0;
            font-size: 14px;
        }

        .section_lable {
            font-size: 10px;
            margin-bottom: 0;
        }

        .section_lable h6 {
            font-size: 12px;
        }

        .img_container {
            margin-bottom: 30px;
        }

        /* hr.section_border {
            border-top: 2px solid black;
            width: 400px;
            float: left;
        } */
        #pageHeader{
            width:540px!important;
          }
          
          .headerWrapper{
            width:538px!important;
            text-align: right;
          }
          .logoWrapper{
            width:538px!important;
            text-align: right;
          }
          .headingWrapper{
            width:538px!important;
            text-align: center;
          }
          
          .headingWrapper p {
            margin:0px!important;
            padding:0px!important;
          }
          
          
    </style>
</head>
